class ProjectListStaffResponseModel {  List<ProjectStaffModel>? data;  ProjectListStaffResponseModel({this.data});  ProjectListStaffResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectStaffModel>[];      json.forEach((v) {        data!.add(new ProjectStaffModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectStaffModel {  int? staffId;  String? fullName;  String? phone1;  String? email;  String? staffType;  int? departmentId;  String? departmentName;  int? branchId;  String? birthday;  String? gender;  String? staffAvatar;  String? address;  bool? isSelected;  ProjectStaffModel(      {this.staffId,        this.fullName,        this.phone1,        this.email,        this.staffType,        this.departmentId,        this.departmentName,        this.branchId,        this.birthday,        this.gender,        this.staffAvatar,        this.address, this.isSelected = false});  ProjectStaffModel.fromJson(Map<String, dynamic> json) {    staffId = json['staff_id'];    fullName = json['full_name'];    phone1 = json['phone1'];    email = json['email'];    staffType = json['staff_type'];    departmentId = json['department_id'];    departmentName = json['department_name'];    branchId = json['branch_id'];    birthday = json['birthday'];    gender = json['gender'];    staffAvatar = json['staff_avatar'];    address = json['address'];    isSelected = false;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['staff_id'] = this.staffId;    data['full_name'] = this.fullName;    data['phone1'] = this.phone1;    data['email'] = this.email;    data['staff_type'] = this.staffType;    data['department_id'] = this.departmentId;    data['department_name'] = this.departmentName;    data['branch_id'] = this.branchId;    data['birthday'] = this.birthday;    data['gender'] = this.gender;    data['staff_avatar'] = this.staffAvatar;    data['address'] = this.address;    return data;  }}